#define HEVC_DSP(depth) hevcdsp->put_pcm = FUNC(put_pcm, depth); hevcdsp->add_residual[0] = FUNC(add_residual4x4, depth); hevcdsp->add_residual[1] = FUNC(add_residual8x8, depth); hevcdsp->add_residual[2] = FUNC(add_residual16x16, depth); hevcdsp->add_residual[3] = FUNC(add_residual32x32, depth); hevcdsp->dequant = FUNC(dequant, depth); hevcdsp->transform_rdpcm = FUNC(transform_rdpcm, depth); hevcdsp->transform_4x4_luma = FUNC(transform_4x4_luma, depth); hevcdsp->idct[0] = FUNC(idct_4x4, depth); hevcdsp->idct[1] = FUNC(idct_8x8, depth); hevcdsp->idct[2] = FUNC(idct_16x16, depth); hevcdsp->idct[3] = FUNC(idct_32x32, depth); hevcdsp->idct_dc[0] = FUNC(idct_4x4_dc, depth); hevcdsp->idct_dc[1] = FUNC(idct_8x8_dc, depth); hevcdsp->idct_dc[2] = FUNC(idct_16x16_dc, depth); hevcdsp->idct_dc[3] = FUNC(idct_32x32_dc, depth); hevcdsp->sao_band_filter[0] = hevcdsp->sao_band_filter[1] = hevcdsp->sao_band_filter[2] = hevcdsp->sao_band_filter[3] = hevcdsp->sao_band_filter[4] = FUNC(sao_band_filter, depth); hevcdsp->sao_edge_filter[0] = hevcdsp->sao_edge_filter[1] = hevcdsp->sao_edge_filter[2] = hevcdsp->sao_edge_filter[3] = hevcdsp->sao_edge_filter[4] = FUNC(sao_edge_filter, depth); hevcdsp->sao_edge_restore[0] = FUNC(sao_edge_restore_0, depth); hevcdsp->sao_edge_restore[1] = FUNC(sao_edge_restore_1, depth); QPEL_FUNCS(depth); QPEL_UNI_FUNCS(depth); QPEL_BI_FUNCS(depth); EPEL_FUNCS(depth); EPEL_UNI_FUNCS(depth); EPEL_BI_FUNCS(depth); hevcdsp->hevc_h_loop_filter_luma = FUNC(hevc_h_loop_filter_luma, depth); hevcdsp->hevc_v_loop_filter_luma = FUNC(hevc_v_loop_filter_luma, depth); hevcdsp->hevc_h_loop_filter_chroma = FUNC(hevc_h_loop_filter_chroma, depth); hevcdsp->hevc_v_loop_filter_chroma = FUNC(hevc_v_loop_filter_chroma, depth); hevcdsp->hevc_h_loop_filter_luma_c = FUNC(hevc_h_loop_filter_luma, depth); hevcdsp->hevc_v_loop_filter_luma_c = FUNC(hevc_v_loop_filter_luma, depth); hevcdsp->hevc_h_loop_filter_chroma_c = FUNC(hevc_h_loop_filter_chroma, depth); hevcdsp->hevc_v_loop_filter_chroma_c = FUNC(hevc_v_loop_filter_chroma, depth)

int i = 0;

switch (bit_depth) {

case 9:

